import React, { Component } from 'react';
import './App.css';
import NavBar from './Components/NavBar/NavBar'

class App extends Component {

  state = {
    currentPage: null,
    word: "Test"
  }

  changeWord(newWord) {

    this.setState({
      word: {newWord}
    })

  }


  render() {
    return (
      <div>
        <h1>ryan slevin</h1>
        <NavBar onClick={() => this.changeWord}/>
        <p>{this.state.word}</p>
      </div>
    );

  }

}

export default App;
